import React from 'react'
import { Link } from 'react-router-dom'

const Tracks = props => {
    props.history.push({
        pathname: "/main/",
        state: {history: props.location.state.list.id, cachedPlaylist: props.location.state.playlist}
      })
    return (
        <div>
            Tracks!
            Linked here by {props.location.state.list.name}
            <Link to={"/main/"}> Go back </Link>
        </div>
    )
}

export default Tracks
